            var l_tmp = JSON.parse(JSON.stringify(data[i]));
            for (var j = 0; j < l_tmp.length; j++) {
                l_tmp[j].haz = Math.exp(-data[i][j].haz * prop);
            }
            tmpdata[i] = l_tmp;
